import * as React from 'react';

import Beer from './Beer';

interface Props {}

interface State {
  beers: string[];
};

export default class Counter extends React.Component<Props, State> {
  state: State = {
    beers: "Maximator"
  };

  render () {
    return (
      <div>
      	<ul>
      		for(const n of beers){
      			<Beer name={this.state.beers} />
      		}
        </ul>
      </div>
    );
  }
}
